import React from 'react';
import { MapTo } from '@adobe/aem-react-editable-components';

require('./index.css')

export const HomePage = ({ title, subtitle, logoImage = {}, backgroundImage = {} }) => {
    return (
        <div className="home-container">
            <header className="header-item-1">
                <img src={logoImage.src} alt='logo' className="compasso-logo" />
            </header>
            <body className="body-container">
                <img src={backgroundImage.src} alt='logo' className="background-image" />
            </body>
            <footer>
                <h1>footer</h1>
            </footer>
        </div>
    )
}

export default MapTo('reactapp/components/home-page')(HomePage);
